window.bookSummaryJSON = "<p><b><i>Ryker</i></b></p> <p><b>I’m not sure what to expect after being away from Tempest for over a year, but the once thriving realm has deteriorated beneath the leadership of its new ruler.</b></p> <p>I made a promise to my dead king to look over Tempest if something happened to him, but after surviving Doomed Valley, I’m done with politics and war.</p> <p><i>Until unexpected events change everything.</i></p> <p><b><i>Ellery</i></b></p> <p>I don’t always have the best ideas, but when I donned a hood to steal from the rich and give to the poor, I thought I was doing the right thing—until I made the mistake of robbing the son of a duke.</p> <p>Forced to work with Ryker to hunt for <i>me</i>, my biggest worry is keeping the truth of my identity from him. That is until our new king unleashes something terrible on Tempest.</p> <p>With everything crumbling around me, I only feel safe with one immortal… <i>the man who is the biggest threat to my freedom</i>.</p> <p><b>Return to the Shadow Realms. A world where immortals unleash lightning, dark fae seduce, witches cast their spells, dragons rule the skies… and the legend of Robin Hood comes alive in a new way.</b></p> <p><i>***The Tempest Series is a spinoff of the Shadow Realms series. You do not have to listen to the Shadow Realms series to follow this one.</i></p> <p><i>Due to sexual content, violence, and language, this book is recommended for listeners 18+ years of age.***</i></p>"; 
